import React from 'react'
import {FaWhatsapp, FaFacebook, FaInstagram} from 'react-icons/fa'
import {HiOutlineMail} from 'react-icons/hi'

const SocialMedia = () => {
const links = [
    {
        id: 1,
        child: (
            <>
                    Whatsapp <FaWhatsapp size={30}/>
            </>
        ),
        href: 'wa.me/6282216637745'
    }
]

  return (
    <div className='flex flex-col top-[35%] left-0 fixed'>
        <ul>

            {links.map(({id,child,href}) => (

            <li key={id} className='flex bg-gray-500 h-11 justify-between items-center w-40 h-1/4 px-4 bg-black ml-[-110px] hover:rounded-md hover:ml-[-10px] duration-300 bg-gray-500'>
                <a href="" className='flex justify-between items-center w-full text-white '>
                <>
                    Whatsapp <FaWhatsapp size={30}/>
            </>
                </a>
            </li>
            ))}
        </ul>
    </div>
  )
}

export default SocialMedia
